import { Link } from "react-router-dom";
import iconHome from '../images/casa.png'
import iconDay from '../images/dia.png'
import iconWeek from '../images/week.png'
import iconMonth from '../images/month-icon.png'


const Header =()=>{


    return(
        <header className="header">
        <nav className="nav-bar">
            <Link className="nav-options" to='/'><img className="ICONS"src={iconHome} alt="imagen de una casa" /></Link>
            <Link className="nav-options" to='/day'><img className="ICONS" src={iconDay} alt="" /></Link>
            <Link className="nav-options" to='/week'><img className="ICONS"src={iconWeek} alt="" /></Link>
            <Link className="nav-options" to='/month'><img className="ICONS" src={iconMonth} alt="" /></Link>
            <Link className="nav-options" to='/'>Salir</Link>
        </nav>
    </header>
    )
}

export default Header;
